/**
 * 名称:费用模型
 * 担当:
 */
class Fee_Model extends CI_Model
{

    /**
     * 订单费用
     */
    public function order_fee_obj($trade_type, $price)
    {

        switch ($trade_type) {
            // 文字好评   超级搜索任务
            case '1':
            case '90':
                return $this->order_fee_obj_char($price);
                break;
            // 回访订单
            case '2':
            case '114':
            case '214':
                return $this->order_fee_obj_back($price);
                break;
            // 图文好评
            case '3':
                return $this->order_fee_obj_pic($price);
                break;
            // 聚划算
            case '4':
                return $this->order_fee_obj_jhs($price);
                break;
            // 淘抢购
            case '5':
                return $this->order_fee_obj_tqg($price);
                break;
            case '6':                                       // 普通搜索订单（京东）
                return $this->order_fee_obj_jd($price);
                break;
            case '7':                                       // 链接直拍（京东）
                return $this->order_fee_obj_jd_url($price);
                break;
            case '140':
                return $this->order_fee_obj_pdd($price);
                break;
        }
    }

