    /** 拼多多订单费用 */
    private function order_fee_obj_pdd($price)
    {
        if (floatval($price) >= 50) {
            $total_fee = 6 + ceil(($price - 50) / 100);
        } elseif (floatval($price) >= 30) {
            $total_fee = 6;
        } elseif (floatval($price) >= 10) {
            $total_fee = 5;
        } else {
            $total_fee = 4;
        }

        return (object)['base_reward' => floatval($total_fee/2), 'snatch_gold' => 0, 'total_fee' => floatval($total_fee)];
    }
